  struct LoanRequest{
    address borrower;
    address guarantor;
    address loaner;
    uint amount;
    uint expiryDate;
    uint interestPaid;
  }

  LoanRequest[] loan_requests;
  uint loanRequestCount = 0;



  function submitLoanRequest(uint amount, uint expiryDate, uint interest) public payable returns(uint) {

    loan_requests.push(LoanRequest(msg.sender,
                                   address(0),
                                   address(0),
                                   amount, 
                                   expiryDate, 
                                   interest));

    loanRequestCount++;
    return loanRequestCount;
  }

